import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SideMenyComponent } from './components/side-meny/side-meny.component';



@NgModule({
  declarations: [
    SideMenyComponent
  ],
  imports: [
    CommonModule
  ],
  exports: [
    SideMenyComponent
  ]
})
export class SharedModule { }
